function deleteItem(e){swal({title:"Are you sure?",text:"You won't be able to revert this!",type:"warning",buttons:{confirm:{text:"Yes, delete it!",className:"btn btn-success"},cancel:{visible:!0,className:"btn btn-danger"}}}).then((t=>{t?($.ajax({url:"/?id="+e,type:"DELETE",success:function(e){location.replace("/")},error:function(e){swal("Error!",JSON.stringify(e.message||"An unknown error occurred."),{icon:"error",buttons:{confirm:{className:"btn btn-danger"}}})}}),swal("Event has been deleted!",{icon:"success",buttons:{confirm:{className:"btn btn-success"}}})):swal.close()}))}